svg.script:
var tooltips = new Array();
var tooltip_bgs = new Array();
var tooltip_dx = new Array();
var tooltip_dy = new Array();
var tooltip_bg_dx = new Array();
var tooltip_bg_dy = new Array();
var x0, y0, h0;

function init(evt) { 
  if ( window.svgDocument == null ) {
    svgDocument = evt.target.ownerDocument;
  }
  tooltip_names = ['tooltip', 'tooltip2', 'tooltip3'];
  tooltip_bg_names = ['tooltip_bg', 'tooltip_bg2'];
  for (x in tooltip_names) {
    tooltips[x] = svgDocument.getElementById(tooltip_names[x]);
  }
  for (x in tooltip_bg_names) {
    tooltip_bgs[x] = svgDocument.getElementById(tooltip_bg_names[x]);
  }
  h(null);
  x0 = tooltip_bgs[0].getAttributeNS(null,"x");
  y0 = tooltip_bgs[0].getAttributeNS(null,"y");
  h0 = tooltip_bgs[0].getAttributeNS(null,"height");
  for (i in tooltips) {
    x1 = tooltips[i].getAttributeNS(null,"x");
    y1 = tooltips[i].getAttributeNS(null,"y");
    tooltip_dx[i] = x1 - x0;
    tooltip_dy[i] = y1 - y0;
  }
  for (i in tooltip_bgs) {
    x1 = tooltip_bgs[i].getAttributeNS(null,"x");
    y1 = tooltip_bgs[i].getAttributeNS(null,"y");
    tooltip_bg_dx[i] = x1 - x0;
    tooltip_bg_dy[i] = y1 - y0;
  }
}

function s(evt, t1, t2, t3) {
  var posx = 0;
  var posy = 0;
  if (!evt) var e = window.event;
  if (evt.pageX || evt.pageY) {
    posx = evt.pageX;
    posy = evt.pageY;
  } else if (e.clientX || e.clientY) {
    posx = evt.clientX + document.body.scrollLeft
      + document.documentElement.scrollLeft;
    posy = evt.clientY + document.body.scrollTop
      + document.documentElement.scrollTop;
  }
  tooltips[0].firstChild.data = t1;
  tooltips[1].firstChild.data = t3;
  tooltips[2].firstChild.data = t2;
  //length = tooltips[0].getComputedTextLength();

  for (i in tooltips) {
    tooltips[i].setAttributeNS(null,"x", posx + tooltip_dx[i]);
    tooltips[i].setAttributeNS(null,"y", posy + tooltip_dy[i] - h0);
    tooltips[i].setAttributeNS(null,"visibility","visible");
  }
  for (i in tooltip_bgs) {
    tooltip_bgs[i].setAttributeNS(null,"x", posx + tooltip_bg_dx[i]);
    tooltip_bgs[i].setAttributeNS(null,"y", posy + tooltip_bg_dy[i] - h0);
    tooltip_bgs[i].setAttributeNS(null,"visibility","visibile");        
  }
}

function h(evt) {
  for (i in tooltips) {
    tooltips[i].setAttributeNS(null,"visibility","hidden");
  }
  for (i in tooltip_bgs) {
    tooltip_bgs[i].setAttributeNS(null,"visibility","hidden");
  }
}

function g(evt, locus_tag) {
  window.open("http://www.ncbi.nlm.nih.gov/gene?term=" + locus_tag);
}

function m(evt, txt) {
  if (evt.type == "click" && evt.detail == 2) {          
    window.open("http://www.ncbi.nlm.nih.gov/gene?term=" + txt);
  } 
}
